import React from 'react';
import * as cal from './Heading.jsx';
import contact from './contacts.js'
import './index.css';

function createcards(contact){
    return (
      <cal.Cardz 
        key = {contact.id}
        name = {contact.name}
        tel = {contact.tel}
        email = {contact.email}
      />
    )
  }

function App() {
    return contact.map(createcards)
}
export default App;
